import {
    CREATE_PROFILE,
} from './types'
import apis from '../api';

export const createProfile = (e, profile) => dispatch => {
    e.preventDefault()
    apis.newProfile(profile)
    console.log(profile);
    dispatch({
        type: CREATE_PROFILE,
        payload: profile
    })
}
